import './App.css';

function App()
{
	let questions = [
		{
			question_text: "What?",
			id: 1,
		},
		{
			question_text: "Who?",
			id: 2,
		},
	];

	let q_jsx = questions.map((q) => {
		return (
			<li>
			<h3>q.question_text</h3>
			</li>
		);
	});

	return (
		{ q_jsx }
	);
}

export default App;
